(1, 'Nuovo', 1, '2022-12-03 14:13:40', 'Libro nuovo, intatto e non letto, in perfette condizioni, senza pagine mancanti o danneggiate.'),
(2, 'Come nuovo', 1, '2022-12-03 14:14:38', 'Libro che sembra nuovo anche se è già stato letto. La copertina non presenta segni di usura visibili ed è inclusa la sovraccoperta (se applicabile) per le copertine rigide. Nessuna pagina mancante o danneggiata, piegata o strappata, nessuna sottolineatura/evidenziazione di testo né scritte ai margini. Potrebbe presentare minimi segni identificativi sulla copertina interna. Mostra piccolissimi segni di usura.'),
(3, 'Ottime condizioni', 1, '2022-12-03 14:15:19', 'Libro che non sembra nuovo ed è già stato letto, ma è in condizioni eccellenti. Nessun danno evidente alla copertina, dotato di sovraccoperta (se applicabile) per le copertine rigide. Nessuna pagina mancante o danneggiata, piegata o strappata, nessuna sottolineatura/evidenziazione di testo né scritte ai margini. Potrebbe presentare minimi segni identificativi sulla copertina interna. Mostra piccolissimi segni di usura.'),
(4, 'Buone condizioni', 1, '2022-12-03 14:15:34', 'Libro che è già stato letto ma è in buone condizioni. Mostra piccolissimi danni alla copertina incluse alcune rigature, ma nessun foro o strappo. È possibile che la sovraccoperta per le copertine rigide non sia inclusa. La rilegatura presenta minimi segni di usura. La maggior parte delle pagine non è danneggiata e mostra una quantità minima di piegature o strappi, sottolineature di testo a matita, nessuna evidenziazione di testo né scritte ai margini. Non ci sono pagine mancanti.'),
(5, 'Accettabile', 1, '2022-12-03 14:15:45', 'Libro con evidenti segni di usura. Può avere alcuni danni alla copertina, senza che l\'integrità sia compromessa. La rilegatura può essere leggermente danneggiata, senza che l\'integrità sia compromessa. Può avere scritte ai margini, sottolineature ed evidenziazioni di testo, ma nessuna pagina mancante né altri danni che potrebbero compromettere la leggibilità o la comprensibilità del testo.');
